const styles = theme => ({
    root: {
        padding: theme.spacing(3)
    },
    content: {
        paddingTop: 15,
        textAlign: 'center'
    },
    image: {
        marginTop: 50,
        display: 'inline-block',
        maxWidth: '100%',
        width: 560
    }
});
export default styles;
